import React, { useState } from "react";
import "./mcq.css";

const MCQ = () => {
  // Define the questions, options, and correct answers
  const questions = [
    {
      question: "An array A consists of n integers in locations A[0], A[1], ... A[n-1]. It is required to shift the elements of the array cyclically to the left by k places, where 1 ≤ k ≤ (n - 1). An incomplete algorithm for doing this in linear time, without using another array is given below. Complete the algorithm by filling in the blanks.",
      options: [
        "i > min; j != (n + i) mod n; A[j + k] = temp; i + 1;",
        "i < min; j != (n + i - k) mod n; A[(j + k) mod n] = temp; i + 1;", // Correct
        "i < min; j != (n + i + k) mod n; A[j + k] = temp; i + 1;",
        "i > min; j != (n + i + k) mod n; A[(j + k) mod n] = temp; i + 1;",
      ],
      correctAnswer: "i < min; j != (n + i - k) mod n; A[(j + k) mod n] = temp; i + 1;",
    },
    {
      question: "What is the time complexity of binary search in a sorted array?",
      options: ["O(n)", "O(log n)", "O(n^2)", "O(1)"],
      correctAnswer: "O(log n)",
    },
    {
      question: "Which data structure is used in a Breadth-First Search (BFS) traversal?",
      options: ["Stack", "Queue", "Priority Queue", "Linked List"],
      correctAnswer: "Queue",
    },
  ];

  // State to track the current question and the selected option
  const [answeredQuestions, setAnsweredQuestions] = useState([]);

  // Handle option selection and answer submission
  const handleOptionClick = (question, option) => {
    const isAnswerCorrect = option === question.correctAnswer;
    setAnsweredQuestions([
      ...answeredQuestions,
      { question, selectedOption: option, isAnswerCorrect },
    ]);
  };

  // Move to the next question
  const handleNextQuestion = () => {
    // Optionally, reset or perform additional logic here
  };

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar" id="navbar">
        <div className="logo">EduTech</div>
        <ul className="nav-links">
          <li><a href="#home" >Home</a></li>
          <li><a href="#courses">Course</a></li>
          <li><a href="#about-us" >About Us</a></li>
          <li><a href="#mentor">Mentor</a></li>
          <li>
            <button className="login-button">Login</button>
          </li>
        </ul>
      </nav>

      <div className="tagline" id="home">
        <div className="tagline-content">
          <h1 className="tagline-title">
            <span className="tagline-red">Empower</span> Your Learning <span className="tagline-red">Journey</span>
          </h1>
          <p className="tagline-subtitle">Unlock your potential with our expertly crafted courses</p>
          <button className="explore-button">Explore Courses</button>
        </div>
      </div>

      <div className="mcq-container">
        {questions.map((currentQuestion, questionIndex) => {
          const answered = answeredQuestions.find(
            (answer) => answer.question === currentQuestion
          );
          return (
            <div key={questionIndex} className="question">
              <p>{currentQuestion.question}</p>
              <div className="options">
                {currentQuestion.options.map((option, index) => (
                  <div
                    key={index}
                    className={`option ${answered?.selectedOption === option ? "selected" : ""}`}
                    onClick={() => handleOptionClick(currentQuestion, option)}
                  >
                    <p>{option}</p>
                    {answered?.selectedOption === option && (
                      <div
                        className={`feedback ${
                          answered?.isAnswerCorrect ? "correct" : "incorrect"
                        }`}
                      >
                        {answered?.isAnswerCorrect ? "Correct!" : "Incorrect, try again!"}
                      </div>
                    )}
                  </div>
                ))}
              </div>
            </div>
          );
        })}

        <div className="navigation-buttons">
          <button onClick={handleNextQuestion}>Next</button>
        </div>
      </div>
    </div>
  );
};

export default MCQ;
